C.Fq=new M.he("Online Privacy\n\nAndrious Solutions Ltd. has conducted its business with integrity and the highest level of trust. Be assured, no information given will be shared.\n\nNon-Personal Information\n\nIn general, you may visit Andrious Solutions Ltd. on the World Wide Web without revealing any information about yourself. We may collect and store information about your visit on an anonymous, aggregate basis. This information may include the time and length of your visit, the pages you look at on the website. We may also record the name of your Internet service provider, browser type, and country of origin. We use this information only to measure site activity and to develop ideas for improving our website.\n\nPersonal Information\n\nAndrious Solutions Ltd. may ask you to provide information that personally identifies you, such as name, e-mail address, mailing address or phone number ('Personal Information'). This will occur only in special circumstances. We may use your Personal Information for three primary purposes. Collect, analyze, segment, identify metrics and build reports that rely on common analytic tools and services. Creation of online marketing dashboards that depict key metrics related to traffic information, conversion rates, online customer behavior / experience, etc. Integrate analytic insights to drive recommendations across multiple platforms and programs.\n\nCookies / Tags\n\n'Cookies' are small pieces of information that are stored by your browser on your computer's hard drive. Our cookies do not contain any personally identifying information. They only contain a secure identifying code that we use to match you to your Personal Information whenever you return to our site. Your Personal Information is never directly connected to nor stored on your computer, but is accessed when we identify your cookie to provide you with a more personalized experience when visiting our site.\n\nWhat Information Do We Collect?\n\nThe type of information we maintain falls into two categories. The first is general information, typically a supplied by you email address and for specific programs we may request a name, billing address, e-mail address, company name, etc. with your consent. We do not store credit card information as part of your Personal Information. We also store information about how you navigate our site so that when you return to it again, we may present you with a more efficient, personalized experience based upon your interests and needs. As we continue to develop the website, we hope to continually increase the personally customized quality of your browsing experiences. Andrious Solutions Ltd. reserves the right to alter our privacy principles as business needs require. Any alterations to these principles will be posted on our web site in a timely manner.\n\nPlease feel free to contact us with any questions, comments, or concerns.",null,null,null)
